import { Container } from '@material-ui/core';
// import Content from '../index.js';

//Photography Section
export default class PhotoContainer extends React.Component{
  render(){
    return(
      <Container maxWidth="lg">
        <p>I added a change 2</p>
      </Container>
    );
  }
}
